import { useParams } from 'react-router-dom';

export default function ViewDocument() {
  const { token } = useParams();
  const fileUrl = `http://localhost:5000/api/files/access/${token}`;

  return (
    <div>
      <h2>View Document</h2>
      <iframe src={fileUrl} width="100%" height="600px" title="Doc Viewer" />
    </div>
  );
}
